import bcrypt from 'bcryptjs';
import DBStorage from "../utils/db";
import Session from '../utils/session';
import cookie_client from '../utils/cookies';
import User from "../utils/models/users";

const db = new DBStorage();
export default class UsersController {
    static async signup(req, res){
        const { email, password, firstName, lastName } = req.body;

        if (!email) {
            return res.status(400).send({ error :"Missing email" });
        }
        if (!password) {
            return res.status(400).send({ error : "Missing password" });
        }
        if (!firstName) {
            return res.status(400).send({ error :"Missing first name" });
        }
        if (!lastName) {
            return res.status(400).send({ error : "Missing last name" });
        }

        // Establish a connection to the database
        await db.connect();
        console.log(`Is database connection alive? ${db.isAlive()}`);

        const schemaVersion = process.env.SCHEMA_VERSION || 1.0;

        bcrypt.genSalt(10, (err, salt) => {
            bcrypt.hash(password, salt, async (err, hash) => {
                if (err) {
                    // await db.closeConnection();
                    console.error('Password Encryption Error');
                    return res.status(500).redirect('/');
                }
                const hashedPassword = hash;
                const newUser = new User({
                    first_name: firstName,
                    last_name: lastName,
                    email: email,
                    password: hashedPassword,
                    salt: salt,
                    schema_version: schemaVersion,
                });

                if (!newUser) {
                    // await db.closeConnection();

                    console.error('User Creation Error');
                    return res.status(400).redirect('/');
                }

                // Save new user in database and close connection
                await newUser.save();
                // await db.closeConnection();
                // console.log(`Is database connection alive? ${db.isAlive()}`);

                return res.redirect(302, '/auth/login');
            });
        });
    }

    static async login(req, res){
        const { email, password } = req.body;

        if (!email) {
            return res.status(400).send({ error :"Missing email" });
        }
        if (!password) {
            return res.status(400).send({ error : "Missing password" });
        }

        // Establish a connection to the database
        await db.connect();
        // console.log(`Is database connection alive? ${db.isAlive()}`);

        const user = await User.findOne({ email }).exec();

        if (!user) {
            // await db.closeConnection();

            console.error('User Retrieval Error');
            return res.status(404).redirect('/auth/login');
        }

        const hashedPassword = user.password;
        bcrypt.compare(password, hashedPassword, async (err, result) => {
            if (err) {
                // await db.closeConnection();
                // console.log(`Is database connection alive? ${db.isAlive()}`);

                console.error('Password Decryption Error');
                return res.status(500).redirect('/');
            }
            else if (result === true) {
                // Set session token, pass expiration time in hours
                const userSessionToken = await Session.setUser(user._id, 24);
                console.log(`User session token: ${userSessionToken}`);
                const cookies = cookie_client(userSessionToken);

                // Sending cookies to browser
                res.set('Set-Cookie', [...cookies]);
                // await db.closeConnection();
                // console.log(`Is database connection alive? ${db.isAlive()}`);

                return res.status(200).redirect(`/${user._id}/explore`);
            }
            else {
                // await db.closeConnection();
                // console.log(`Is database connection alive? ${db.isAlive()}`);

                return res.status(401).send('Error: Incorrect password');
            }
        })
    }

    static async logout(req, res){
        const userSessionToken = req.cookies.get('session');

        if (!userSessionToken) {
            return res.status(401).redirect('/auth/login');
        }

        const userId = Session.getUser(userSessionToken).get('userId');
        if (!userId) {
            return res.status(401).redirect('/auth/login');
        }

        await Session.deleteUser(userSessionToken);
        return res.status(204).redirect('/');
    }

    static async updateUser(req, res){
        const userSessionToken = req.cookies.get('session');

        if (!userSessionToken) {
            return res.status(401).redirect('/auth/login');
        }

        // Establish a connection to the database
        await db.connect();
        // console.log(`Is database connection alive? ${db.isAlive()}`);

        const userId = Session.getUser(userSessionToken).get('userId');
        if (!userId) {
            // await db.closeConnection();
            // console.log(`Is database connection alive? ${db.isAlive()}`);

            return res.status(401).redirect('/auth/login');
        }

        const user = await User.findOneById({ _id: userId });

        if (!user) {
            // await db.closeConnection();
            // console.log(`Is database connection alive? ${db.isAlive()}`);

            console.error('User Retrieval Error');
            return res.status(404).redirect('/auth/login');
        }

        const { email, password, firstName, lastName } = req.body;
        if (email) {
            await User.updateOne(
                { _id: userId }, { email }, { updated_at: new Date() });
        }
        if (password) {
            let hashedPassword;
            bcrypt.genSalt(10, (err, salt) => {
                bcrypt.hash(password, salt, async (err, hash) => {
                    if (err) {
                        // await db.closeConnection();
                        // console.log(`Is database connection alive? ${db.isAlive()}`);

                        console.error('Password Encryption Error');
                        return res.status(500).redirect('/');
                    }
                    hashedPassword = hash;
                    await User.updateOne(
                        { _id: userId }, { password: hashedPassword }, { updated_at: new Date() });
                });
            });
        }
        if (firstName) {
            await User.updateOne(
                { _id: userId }, { first_name: firstName }, { updated_at: new Date() });
        }
        if (lastName) {
            await User.updateOne(
                { _id: userId }, { last_name: lastName }, { updated_at: new Date() });
        }

        // Close connection to the database
        // await db.closeConnection();
        // console.log(`Is database connection alive? ${db.isAlive()}`);

        return res.status(200).send('User details updated successfully');
    }

    static async deleteUser(req, res){
        const userSessionToken = req.cookies.get('session');

        if (!userSessionToken) {
            return res.status(401).redirect('/auth/login');
        }

        const userId = Session.getUser(userSessionToken).get('userId');
        if (!userId) {
            return res.status(401).redirect('/auth/login');
        }

        await db.connect();
        // console.log(`Is database connection alive? ${db.isAlive()}`);

        await User.deleteOne({ _id: userId });
        await Session.deleteUser(userSessionToken);

        // await db.closeConnection();
        // console.log(`Is database connection alive? ${db.isAlive()}`);

        return res.status(204).redirect('/');
    }

    static async googleUser(req, res){}

    static async githubUser(req, res){}
}

