import { createClient } from 'redis';
import { promisify } from 'util';


class RedisClient {
  constructor() {
    this.client = createClient();
    this.client.on('error', (error) => {
      console.log(`RedisClient Connection Error: ${error.message}`);
    });

    this.client.on('connect', () => {
        console.log("RedisClient connected succesfully");
    });
  }

  isAlive() {
    return this.client.isOpen;
  }

  async get(key) {
    const getAsync = promisify(this.client.get).bind(this.client);
    const value = await getAsync(key);
    return value;
  }

  async set(key, value, time) {
    const asyncSet = promisify(this.client.set).bind(this.client);
    await asyncSet(key, value, 'EX', time);
  }

  async del(key) {
    this.client.del(key);
  }

  async checkExpiration(key) {
    const asyncTtl = promisify(client.ttl).bind(client);
    const remainingTime = await asyncTtl(key);
    return remainingTime;
  }
}

const redisClient = new RedisClient();
export default redisClient;

