import session from './session';

class Cookies {
  static async setCookies(token) {
    const expiryDate = new Date().toUTCString();
    const cookiesToSend = {
      session: token,
      Expires: expiryDate,
      domain: 'flanders.tech',
      SameSite: 'Strict',
    };

    return cookiesToSend;
  }
}

const cookie_client = new Cookies;

export default cookie_client;
